const Counter = ({ onIncrement, onDecrement }) => {
  return (
    <div
      className="counter"
      onClick={onIncrement}
      onContextMenu={e => {
        e.preventDefault();
        onDecrement();
      }}
    ></div>
  );
};

export default Counter;
